INSERT INTO `SERVICE_CALL_LOG` VALUES ('37', '8', null, '19012816320783959653', 'drivingQuestionsQuery', '{\"page_number\":\"1\",\"question_subject\":\"1\",\"question_type\":\"C1\"}', '2019-01-28 16:32:09', '{\"status\":\"0\",\"msg\":\"ok\",\"list\":[{\"question\":\"驾驶机动车在道路上违反道路交通安全法的行为，属于什么行为？\",\"option1\":\"A、违章行为\",\"option2\":\"B、违法行为\",\"option3\":\"C、过失行为\",\"option4\":\"D、违规行为\",\"answer\":\"B\",\"explain\":\"违反《道路交通安全法》，属于违法行为。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"机动车驾驶人违法驾驶造成重大交通事故构成犯罪的，依法追究什么责任？\",\"option1\":\"A、刑事责任\",\"option2\":\"B、民事责任\",\"option3\":\"C、经济责任\",\"option4\":\"D、直接责任\",\"answer\":\"A\",\"explain\":\"根据《道路交通安全法》第一百零一条规定：违反道路交通安全法律、法规规定，发生重大交通事故，构成犯罪的，依法追究刑事责任，并由公安机关交通管理部门吊销机动车驾驶证。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"quest...而不论其造成交通事故后果的大小。也就是说，法律规定惩罚的交通肇事逃逸行为，与驾驶人造成交通事故后果的轻重无关；构成犯罪的，依法追究刑事责任。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"驾驶机动车违反道路交通安全法律法规发生交通事故属于交通违章行为。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"错\",\"explain\":\"“违反道路交通安全法”，违反法律法规即为违法行为。官方已无违章和违规的说法了。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"驾驶机动车在道路上违反道路通行规定应当接受相应的处罚。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"对\",\"explain\":\"违反道路通行规定势必要受到相应处罚的，避免下次再犯。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"}]}', '2019-01-28 16:32:32', '2019-01-28 16:32:09', '0');
INSERT INTO `SERVICE_CALL_LOG` VALUES ('38', null, null, '19012817051393017120', 'intelligentAssistantQA', '{\"question\":\"苏东坡是什么人\"}', '2019-01-28 17:05:14', '{\"status\":\"0\",\"msg\":\"ok\",\"content\":\"苏轼（1037年1月8日—1101年8月24日），字子瞻，又字和仲，号铁冠道人、东坡居士，世称苏东坡、苏仙，123汉族，眉州眉山（今属四川省眉山市）人，祖籍河北栾城，北宋著名文学家、书法家、画家。4嘉祐二年（1057年），苏轼进士及第。宋神宗时曾在凤翔、杭州、密州、徐州、湖州等地任职。元丰三年（1080年），因“乌台诗案”被贬为黄州团练副使。宋哲宗即位后，曾任翰林学士、侍读学士、礼部尚书等职，并出知杭州、颍州、扬州、定州等地，晚年因新党执政被贬惠州、儋州。宋徽宗时获大赦北还，途中于常州病逝。宋高宗时追赠太师，谥号“文忠”4。苏轼是北宋中期的文坛领袖，在诗、词、散文、书、画等方面取得了很高的成就。\"}', '2019-01-28 17:05:17', '2019-01-28 17:05:14', '0');
