INSERT INTO `SERVICE_CALL_LOG` VALUES ('44', '8', null, '19012817480674990470', 'drivingQuestionsQuery', '{\"page_number\":\"1\",\"question_subject\":\"1\",\"question_type\":\"C1\"}', '2019-01-28 17:48:07', '{\"status\":\"0\",\"msg\":\"ok\",\"list\":[{\"question\":\"驾驶机动车在道路上违反道路交通安全法的行为，属于什么行为？\",\"option1\":\"A、违章行为\",\"option2\":\"B、违法行为\",\"option3\":\"C、过失行为\",\"option4\":\"D、违规行为\",\"answer\":\"B\",\"explain\":\"违反《道路交通安全法》，属于违法行为。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"机动车驾驶人违法驾驶造成重大交通事故构成犯罪的，依法追究什么责任？\",\"option1\":\"A、刑事责任\",\"option2\":\"B、民事责任\",\"option3\":\"C、经济责任\",\"option4\":\"D、直接责任\",\"answer\":\"A\",\"explain\":\"根据《道路交通安全法》第一百零一条规定：违反道路交通安全法律、法规规定，发生重大交通事故，构成犯罪的，依法追究刑事责任，并由公安机关交通管理部门吊销机动车驾驶证。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"quest...而不论其造成交通事故后果的大小。也就是说，法律规定惩罚的交通肇事逃逸行为，与驾驶人造成交通事故后果的轻重无关；构成犯罪的，依法追究刑事责任。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"驾驶机动车违反道路交通安全法律法规发生交通事故属于交通违章行为。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"错\",\"explain\":\"“违反道路交通安全法”，违反法律法规即为违法行为。官方已无违章和违规的说法了。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"驾驶机动车在道路上违反道路通行规定应当接受相应的处罚。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"对\",\"explain\":\"违反道路通行规定势必要受到相应处罚的，避免下次再犯。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"}]}', '2019-01-28 17:48:07', '2019-01-28 17:48:07', '0');
INSERT INTO `SERVICE_CALL_LOG` VALUES ('45', '8', null, '19012817512084297404', 'drivingQuestionsQuery', '{\"page_number\":\"1000\",\"question_subject\":\"1\",\"question_type\":\"C1\"}', '2019-01-28 17:51:21', '{\"status\":\"0\",\"msg\":\"ok\",\"list\":[{\"question\":\"车辆发生意外，要及时打开哪个灯?\",\"option1\":\"A、图1\",\"option2\":\"B、图2\",\"option3\":\"C、图3\",\"option4\":\"D、图4\",\"answer\":\"D\",\"explain\":\"图1是示宽指示灯；图2是雾灯指示灯；图3是远光指示灯；图4是危险报警闪光灯按钮，发生意外时应该打开危险报警闪光灯。\",\"pic\":\"http://api.jisuapi.com/driverexam/upload/4c8fa.jpg\",\"type\":\"\",\"chapter\":\"机动车驾驶操作相关基础知识\"}]}', '2019-01-28 17:51:21', '2019-01-28 17:51:21', '0');
INSERT INTO `SERVICE_CALL_LOG` VALUES ('46', null, null, '19012817523216748855', 'drivingQuestionsQuery', '{\"page_number\":\"200000\",\"question_subject\":\"1\",\"question_type\":\"C1\"}', '2019-01-28 17:52:32', '{\"status\":\"0\",\"msg\":\"ok\",\"list\":[{\"question\":\"车辆发生意外，要及时打开哪个灯?\",\"option1\":\"A、图1\",\"option2\":\"B、图2\",\"option3\":\"C、图3\",\"option4\":\"D、图4\",\"answer\":\"D\",\"explain\":\"图1是示宽指示灯；图2是雾灯指示灯；图3是远光指示灯；图4是危险报警闪光灯按钮，发生意外时应该打开危险报警闪光灯。\",\"pic\":\"http://api.jisuapi.com/driverexam/upload/4c8fa.jpg\",\"type\":\"\",\"chapter\":\"机动车驾驶操作相关基础知识\"}]}', '2019-01-28 17:52:32', '2019-01-28 17:52:32', '0');
INSERT INTO `SERVICE_CALL_LOG` VALUES ('47', '8', null, '19012817585722098388', 'drivingQuestionsQuery', '{\"page_number\":\"200000\",\"question_subject\":\"1\",\"question_type\":\"A2\"}', '2019-01-28 17:58:57', '{\"status\":\"0\",\"msg\":\"ok\",\"list\":[{\"question\":\"全挂列车倒车，要避免牵引车与挂车形成较大的角度。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"错\",\"explain\":\"牵引车与挂车形成较大的角度，是对的。但是他说要避免较大角度，那他意思是以较小角度， 所以他答案就是错的。\",\"pic\":\"\",\"type\":\"A2,B2\",\"chapter\":\"货车专用试题\"},{\"question\":\"车辆下长坡过程中，遇制动鼓温度过高时，不要立即进入冷水中冷却，以免造成制动鼓损坏。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"对\",\"explain\":\"热涨冷缩，制动鼓会裂开的，再就是制动鼓过热骤冷退火，强度大大下降，也会坏掉。\",\"pic\":\"\",\"type\":\"A2,B2\",\"chapter\":\"货车专用试题\"},{\"question\":\"持有大型客车、牵引车、城市公交车、中型客车、大型货车驾驶证的驾驶人，应当在联系电话、联系地址以及从业单位等信息发生变化...市公交车、中型客车、大型货车准驾车型驾驶证的驾驶人从业单位等信息发生变化，应在信息变更后三十日内，向驾驶证核发地车辆管理所备案”。\",\"pic\":\"\",\"type\":\"A2,B2\",\"chapter\":\"货车专用试题\"},{\"question\":\"持有大型货车驾驶证的驾驶人在一个记分周期内有记满12分记录的，车辆管理所应当注销其最高准驾车型驾驶资格。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"对\",\"explain\":\"《公安部令第123号》第六十八条：持有大型客车、牵引车、城市公交车、中型客车、大型货车驾驶证的驾驶人有下列情形之一的，车辆管理所应当注销其最高准驾车型驾驶资格，并通知机动车驾驶人在三十日内办理降级换证业务：（一）发生交通事故造成人员死亡，承担同等以上责任，未构成犯罪的；（二）在一个记分周期内有记满1\",\"pic\":\"\",\"type\":\"A2,B2\",\"chapter\":\"货车专用试题\"}]}', '2019-01-28 17:58:58', '2019-01-28 17:58:57', '0');
