INSERT INTO `SERVICE_CALL_LOG` VALUES ('153', '8', null, '19021416310156296186', 'drivingQuestionsQuery', '{\"page_number\":\"1\",\"question_subject\":\"4\",\"question_type\":\"F\"}', '2019-02-14 16:31:02', '{\"status\":\"0\",\"msg\":\"ok\",\"list\":[{\"question\":\"动画1中有几种违法行为？\",\"option1\":\"A、一种违法行为\",\"option2\":\"B、二种违法行为\",\"option3\":\"C、三种违法行为\",\"option4\":\"D、四种违法行为\",\"answer\":\"B\",\"explain\":\"1.不系安全带。2.打电话。\",\"pic\":\"http://api.jisuapi.com/driverexam/upload/1446.gif\",\"type\":\"\",\"chapter\":\"违法行为综合判断与案例分析\"},{\"question\":\"动画2中有几种违法行为？\",\"option1\":\"A、一种违法行为\",\"option2\":\"B、二种违法行为\",\"option3\":\"C、三种违法行为\",\"option4\":\"D、四种违法行为\",\"answer\":\"B\",\"explain\":\"有2种违法行为：1、打电话；2、堵车时占用公交车道通行。\",\"pic\":\"http://api.jisuapi.com/driverexam/upload/1447.gif\",\"type\":\"\",\"chapter\":\"违法行为综合判断与案例分析\"},{\"question\":\"动画3中有几种违法行为？\",\"option1\":\"A、一种违法行为\",\"option2\":\"B、二种违法行为\",\"option3\":\"C、三种违法行为\",\"option4\":\"D、四...析\"},{\"question\":\"动画4中有几种违法行为？\",\"option1\":\"A、一种违法行为\",\"option2\":\"B、二种违法行为\",\"option3\":\"C、三种违法行为\",\"option4\":\"D、四种违法行为\",\"answer\":\"C\",\"explain\":\"1.遮挡车牌。2.闯红灯。3.不按导向箭头行驶。\",\"pic\":\"http://api.jisuapi.com/driverexam/upload/1449.gif\",\"type\":\"\",\"chapter\":\"违法行为综合判断与案例分析\"},{\"question\":\"动画5中有几种违法行为？\",\"option1\":\"A、一种违法行为\",\"option2\":\"B、二种违法行为\",\"option3\":\"C、三种违法行为\",\"option4\":\"D、四种违法行为\",\"answer\":\"C\",\"explain\":\"有3种违法行为：1、开车打电话；2、酒后驾驶；3、无证驾驶。通过驾驶人打电话时的内容来体现是酒后驾驶，无证驾驶，驾驶人电话内容为:“刚喝完酒，在去驾校的路上，准备报名学个驾驶本”！\",\"pic\":\"http://api.jisuapi.com/driverexam/upload/1450.gif\",\"type\":\"\",\"chapter\":\"违法行为综合判断与案例分析\"}]}', '2019-02-14 16:31:04', '2019-02-14 16:31:02', '0');
