INSERT INTO `SERVICE_CALL_LOG` VALUES ('163', null, null, '19021911453507141360', 'weatherQuery', '{\"chinese_city_name\":\"北京\"}', '2019-02-19 11:45:35', '{\"status\":\"0\",\"msg\":\"ok\",\"city\":\"北京\",\"date\":\"2019-02-19 星期二\",\"weather\":\"多云。当前气温0°C，最高温度7°C，最低温度-4°C。西南风1级，风速1.2m/s。湿度89%。气压1017Pa。\",\"img\":\"1\",\"index\":[\"空调指数：较少开启，您将感到很舒适，一般不需要开启空调。\",\"运动指数：较适宜，天气较好，无雨水困扰，较适宜进行各种运动，但因气温较低，在户外运动请注意增减衣物。\",\"紫外线指数：最弱，属弱紫外线辐射天气，无需特别防护。若长期在户外，建议涂擦SPF在8-12之间的防晒护肤品。\",\"感冒指数：较易发，昼夜温差较大，较易发生感冒，请适当增减衣服。体质较弱的朋友请注意防护。\",\"洗车指数：不宜，不宜洗车，未来24小时内有雪，如果在此期间洗车，雪水和路上的泥水可能会再次弄脏您的爱车。\",\"空气污染扩散指数：较差，气象条件较不利于空气污染物稀...3°C。\",\"himg\":\"0\"},{\"dec\":\"13:00，晴，5°C。\",\"himg\":\"0\"},{\"dec\":\"14:00，晴，6°C。\",\"himg\":\"0\"},{\"dec\":\"15:00，晴，7°C。\",\"himg\":\"0\"},{\"dec\":\"16:00，晴，7°C。\",\"himg\":\"0\"},{\"dec\":\"17:00，晴，6°C。\",\"himg\":\"0\"},{\"dec\":\"18:00，晴，5°C。\",\"himg\":\"0\"},{\"dec\":\"19:00，晴，2°C。\",\"himg\":\"0\"},{\"dec\":\"20:00，晴，1°C。\",\"himg\":\"0\"},{\"dec\":\"21:00，晴，1°C。\",\"himg\":\"0\"},{\"dec\":\"22:00，晴，0°C。\",\"himg\":\"0\"},{\"dec\":\"23:00，晴，-1°C。\",\"himg\":\"0\"},{\"dec\":\"0:00，晴，-1°C。\",\"himg\":\"0\"},{\"dec\":\"1:00，晴，-2°C。\",\"himg\":\"0\"},{\"dec\":\"2:00，晴，-2°C。\",\"himg\":\"0\"},{\"dec\":\"3:00，晴，-3°C。\",\"himg\":\"0\"},{\"dec\":\"4:00，晴，-3°C。\",\"himg\":\"0\"},{\"dec\":\"5:00，晴，-3°C。\",\"himg\":\"0\"},{\"dec\":\"6:00，晴，-4°C。\",\"himg\":\"0\"},{\"dec\":\"7:00，晴，-3°C。\",\"himg\":\"0\"},{\"dec\":\"8:00，晴，-2°C。\",\"himg\":\"0\"},{\"dec\":\"9:00，晴，0°C。\",\"himg\":\"0\"},{\"dec\":\"10:00，晴，3°C。\",\"himg\":\"0\"}],\"update\":\"2019-02-19 11:10:00\"}', '2019-02-19 11:45:40', '2019-02-19 11:45:35', '0');
