INSERT INTO `SERVICE_CALL_LOG` VALUES ('210', null, null, '19022615572432834935', 'drivingQuestionsQuery', '{\"page_number\":\"1\",\"question_subject\":\"1\",\"question_type\":\"C1\"}', '2019-02-26 15:57:24', '{\"status\":\"0\",\"msg\":\"ok\",\"list\":[{\"question\":\"驾驶机动车在道路上违反道路交通安全法的行为，属于什么行为？\",\"option1\":\"A、违章行为\",\"option2\":\"B、违法行为\",\"option3\":\"C、过失行为\",\"option4\":\"D、违规行为\",\"answer\":\"B\",\"explain\":\"违反《道路交通安全法》，属于违法行为。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"机动车驾驶人违法驾驶造成重大交通事故构成犯罪的，依法追究什么责任？\",\"option1\":\"A、刑事责任\",\"option2\":\"B、民事责任\",\"option3\":\"C、经济责任\",\"option4\":\"D、直接责任\",\"answer\":\"A\",\"explain\":\"根据《道路交通安全法》第一百零一条规定：违反道路交通安全法律、法规规定，发生重大交通事故，构成犯罪的，依法追究刑事责任，并由公安机关交通管理部门吊销机动车驾驶证。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"quest...而不论其造成交通事故后果的大小。也就是说，法律规定惩罚的交通肇事逃逸行为，与驾驶人造成交通事故后果的轻重无关；构成犯罪的，依法追究刑事责任。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"驾驶机动车违反道路交通安全法律法规发生交通事故属于交通违章行为。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"错\",\"explain\":\"“违反道路交通安全法”，违反法律法规即为违法行为。官方已无违章和违规的说法了。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"驾驶机动车在道路上违反道路通行规定应当接受相应的处罚。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"对\",\"explain\":\"违反道路通行规定势必要受到相应处罚的，避免下次再犯。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"}]}', '2019-02-26 15:57:26', '2019-02-26 15:57:24', '0');
INSERT INTO `SERVICE_CALL_LOG` VALUES ('211', null, null, '19022615573249834654', 'drivingQuestionsQuery', '{\"page_number\":\"2\",\"question_subject\":\"1\",\"question_type\":\"C1\"}', '2019-02-26 15:57:32', '{\"status\":\"0\",\"msg\":\"ok\",\"list\":[{\"question\":\"对未取得驾驶证驾驶机动车的，追究其法律责任。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"对\",\"explain\":\"《道路交通安全法》第九十九条规定：未取得机动车驾驶证、机动车驾驶证被吊销或者机动车驾驶证被暂扣期间驾驶机动车的，由公安机关交通管理部门处二百元以上二千元以下罚款，可以并处十五日以下拘留。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"对违法驾驶发生重大交通事故且构成犯罪的，不追究其刑事责任。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"错\",\"explain\":\"《道路交通安全法》第一百零一条规定：违反道路交通安全法律、法规的规定，发生重大交通事故，构成犯罪的，依法追究刑事责任，并由公安机关交通管理部门吊销机动车驾驶证。\",\"pic\":\"\",\"type\":\"\",\"...公安机关交通管理部门吊销机动车驾驶证，且终生不得重新取得机动车驾驶证。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"驾驶机动车在道路上违反交通安全法规的行为属于违法行为。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"对\",\"explain\":\"“违反道路交通安全法”，违反法律法规即视为违法行为。官方已无违章和违规的说法了。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"驾驶机动车应当随身携带哪种证件？\",\"option1\":\"A、工作证\",\"option2\":\"B、驾驶证\",\"option3\":\"C、身份证\",\"option4\":\"D、职业资格证\",\"answer\":\"B\",\"explain\":\"《道路交通安全法》第十九条：驾驶人应当按照驾驶证载明的准驾车型驾驶机动车；驾驶机动车时，应当随身携带机动车驾驶证。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"}]}', '2019-02-26 15:57:33', '2019-02-26 15:57:32', '0');
INSERT INTO `SERVICE_CALL_LOG` VALUES ('212', null, null, '19022615573686215204', 'drivingQuestionsQuery', '{\"page_number\":\"3\",\"question_subject\":\"1\",\"question_type\":\"C1\"}', '2019-02-26 15:57:37', '{\"status\":\"0\",\"msg\":\"ok\",\"list\":[{\"question\":\"未取得驾驶证的学员在道路上学习驾驶技能，下列哪种做法是正确的？\",\"option1\":\"A、使用所学车型的教练车由教练员随车指导\",\"option2\":\"B、使用所学车型的教练车单独驾驶学习\",\"option3\":\"C、使用私家车由教练员随车指导\",\"option4\":\"D、使用所学车型的教练车由非教练员的驾驶人随车指导\",\"answer\":\"A\",\"explain\":\"《公安部令第123号》规定：未取得驾驶证的学员在道路上学习驾驶技能，使用所学车型的教练车由教练员随车指导。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"机动车驾驶人初次申领驾驶证后的实习期是多长时间？\",\"option1\":\"A、6个月\",\"option2\":\"B、12个月\",\"option3\":\"C、16个月\",\"option4\":\"D、18个月\",\"answer\":\"B\",\"explain\":\"《公安部令第123号》第六十四条规定：机动车驾驶人初次申请机动车驾驶证和增...3\":\"C、1年内\",\"option4\":\"D、5年内\",\"answer\":\"A\",\"explain\":\"吊二撤三醉五逃终身。根据公安部令第123号规定：申请人在考试过程中有贿赂、舞弊行为的，取消考试资格，已经通过考试的其他科目成绩无效；申请人在一年内不得再次申领机动车驾驶证。申请人以欺骗、贿赂等不正当手段取得机动车驾驶证的，公安机关交通管理部门收缴机动车驾驶证，撤销机动车驾驶许可；申请人在三年内不得再次申领机动车驾驶证。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"},{\"question\":\"驾驶人要按照驾驶证载明的准驾车型驾驶车辆。\",\"option1\":\"\",\"option2\":\"\",\"option3\":\"\",\"option4\":\"\",\"answer\":\"对\",\"explain\":\"《公安部令第123号》规定：驾驶与准驾驶车型不符的机动车的违法行为，一次记12分。处罚200以上1000以下的罚款。\",\"pic\":\"\",\"type\":\"\",\"chapter\":\"道路交通安全法律、法规和规章\"}]}', '2019-02-26 15:57:37', '2019-02-26 15:57:37', '0');
