INSERT INTO `SERVICE_CALL_LOG` VALUES ('282', '7', null, '19030410333131996039', 'intelligentAssistantQA', '{\"question\":\"马云\"}', '2019-03-04 10:33:31', '{\"status\":\"0\",\"msg\":\"ok\",\"content\":\"马云，男，汉族，中共党员，1964年9月10日生于浙江省杭州市，祖籍浙江省嵊州市谷来镇， 阿里巴巴集团主要创始人，现担任阿里巴巴集团董事局主席、日本软银董事、大自然保护协会中国理事会主席兼全球董事会成员、华谊兄弟董事、生命科学突破奖基金会董事、联合国数字合作高级别小组联合主席。1988年毕业于杭州师范学院外语系，同年担任杭州电子工业学院英文及国际贸易教师，1995年创办中国第一家互联网商业信息发布网站“中国黄页”，1998年出任中国国际电子商务中心国富通信息技术发展有限公司总经理，1999年创办阿里巴巴，并担任阿里集团CEO、董事局主席。2013年5月10日，辞任阿里巴巴集团CEO，继续担任阿里集团董事局主席。6月30日，马云当选全球互联网治理联盟理事会联合主席。2017年12月15日，荣获“影响中国”2017年度教育人物。\"}', '2019-03-04 10:33:36', '2019-03-04 10:33:31', '0');
