INSERT INTO `SERVICE_CALL_LOG` VALUES ('318', '1', null, '19031116162145068056', 'intelligentAssistantQA', '{\"question\":\"北京\"}', '2019-03-11 16:16:21', '{\"status\":\"0\",\"msg\":\"ok\",\"content\":\"北京，简称“京”，是中华人民共和国省级行政区、首都、直辖市，是全国的政治、文化中心。北京地处中国华北地区，中心位于东经116°20′、北纬39°56′，东与天津毗连，其余均与河北相邻，北京市总面积16410.54平方千米。北京地势西北高、东南低。西部、北部和东北部三面环山，东南部是一片缓缓向渤海倾斜的平原。境内流经的主要河流有：永定河、潮白河、北运河、拒马河等，多由西北部山地发源，穿过崇山峻岭，向东南蜿蜒流经平原地区，最后分别汇入渤海。北京的气候为典型的暖温带半湿润大陆性季风气候，夏季高温多雨，冬季寒冷干燥，春、秋短促。截至2017年底，北京市下辖16个市辖区。截至2017年末，北京市常住人口2170.7万人，实现地区生产总值（GDP）28000.4亿元，第一产业120.5亿元，第二产业5310.6亿元，第三产业22569.3亿元，人均地区生产总值实现12.9万元。\"}', '2019-03-11 16:16:26', '2019-03-11 16:16:21', '0');
