INSERT INTO `SYS_BUSINESS_LOG` VALUES ('1504', '24', 'liulin', '测试', '4cd2d9c1-5f89-49bf-a9ec-b2dc051f0990', '2019-09-16 16:02:20', '审核产品', '查看产品信息审核页面产品信息', '{\"product\":{\"auditDesc\":\"确认产品信息正确，提交审核。\",\"auditStatus\":\"submit\",\"auditTime\":\"2019-09-16 16:02:06\",\"auditorId\":\"24\",\"auditorName\":\"测试\",\"code\":\"\",\"contractNo\":\"\",\"dataStatus\":\"1\",\"editTime\":\"2019-09-16 16:02:06\",\"editorId\":\"24\",\"editorName\":\"测试\",\"geCode\":\"\",\"geName\":\"\",\"hxAcctNo\":\"\",\"hxName\":\"\",\"id\":\"19091615370237776493\",\"ifPrepay\":\"yes\",\"name\":\"\",\"productAdvantage\":\"<p>投资收益=投资本金*[预期年化收益]*产品存续天数/365\\r\\n以本产品预期年化收益6.123%为例：\\r\\n您购买了10万元份额的中铁11号，那么到期后的收益是：\\r\\n(100000*0.06123*38)/365=637.47</p>\",\"productAgreementType\":\"\",\"projectSummary\":\"<p>天津金融资产交易所“中铁11号”收益分享合约产品，本产品在天津金融资产交易所挂牌发行。\\r\\n产品特点：\\r\\n稳收益：预期年化收益达6.123%\\r\\n低风险：本收益分享合约产品的底层资产相关交易由上市公司提供担保增信\\r\\n超安心：国有金融交易中心甄选优质投资标的</p>\",\"publishStatus\":\"notIssue\",\"purchaseDesc\":\"<p>本产品直接使用账户可用余额购买，请提前安排资金，资金可使用绑定卡转入账户参与购买。\\r\\n产品总规模10000000元，起购金额40000元，追加金额10000元的整数倍，单笔最大购买金额1000000元，可多次购买。\\r\\n2019-06-19\\u00A009：00面向全体用户发售。\\r\\n本产品起息日为2019年06月21日，到期日为2109年09月19日，产品到期后本金及利息收益将于3个工作日内转入您的账户余额。\\r\\n请您在购买产品前仔细阅读并确认产品合同及认购协议。</p>\",\"reasonsPrepay\":\"<p>产品管理人享有在起息日满45天后的投资期限内任一天提前终止该产品的权利，并在提前终止日前3个工作日发布通知。投资人无法选择提前结束</p>\",\"repayType\":\"\",\"status\":\"init\",\"tenderAmount\":0.00,\"tenderAuditStatus\":\"init\",\"tenderEndTime\":\"\",\"tenderStartTime\":\"\",\"tenderUsers\":0,\"timeLimitUnit\":\"day\"}}', null, '192.168.1.95');
