tTime\":\"2019-09-16 16:12:45\",\"editorId\":\"24\",\"editorName\":\"测试\",\"id\":\"19091616124508942991\",\"productId\":\"19091616124507819270\",\"type\":\"productOtherAttachFile\"}}', null, '0:0:0:0:0:0:0:1');
