ttachFile\":{\"attachFile\":\"{\\\"交勘接口文档0717.docx\\\":\\\"http://192.168.1.38:85/upload/qiyebao/user/photo/19082610035895619803.docx\\\",\\\"基金模块初表.docx\\\":\\\"http://192.168.1.38:85/upload/qiyebao/user/photo/19082610040436846470.docx\\\"}\",\"createTime\":\"2019-08-26 10:04:17\",\"creatorId\":\"1\",\"creatorName\":\"系统管理员\",\"dataStatus\":\"1\",\"editTime\":\"2019-08-26 10:04:14\",\"editorId\":\"1\",\"editorName\":\"系统管理员\",\"id\":\"19090417433815651153\",\"productId\":\"19090417433815519671\"}}', null, '192.168.1.95');
