INSERT INTO `SYS_BUSINESS_LOG` VALUES ('2405', '1', 'sysadmin', '系统管理员', '98f31032-7a63-4a7a-ae89-a1edd963b07c', '2019-09-18 16:24:52', '审核产品', '查看产品信息审核页面产品信息', '{\"product\":{\"amount\":30000000,\"annualRate\":0.03,\"auditDesc\":\"确认产品信息正确，提交审核。\",\"auditStatus\":\"submit\",\"auditTime\":\"2019-09-04 17:44:20\",\"auditorId\":\"1\",\"auditorName\":\"系统管理员\",\"code\":\"CSCP081\",\"contractNo\":\"CSCP082601h\",\"createTime\":\"2019-08-26 10:04:17\",\"creatorId\":\"1\",\"creatorName\":\"系统管理员\",\"dataStatus\":\"1\",\"editTime\":\"2019-09-04 17:44:20\",\"editorId\":\"1\",\"editorName\":\"系统管理员\",\"geCode\":\"20\",\"geName\":\"金交所测试产品082601\",\"highSingleInvest\":10000000.00,\"hxAcctNo\":\"6262252521214121254\",\"hxName\":\"jjs\",\"id\":\"19090417433815519671\",\"ifPrepay\":\"yes\",\"name\":\"测试产品082601\",\"productAdvantage\":\"<p>投资收益=投资本金*[预期年化收益]*产品存续天数/365\\n以本产品预期年化收益6.123%为例：\\n您购买了10万元份额的中铁11号，那么到期后的收益是：\\n(100000*0.06123*38)/365=637.47</p>\",\"productAgreementType\":\"ksXm\",\"projectSummary\":\"<p>天津金融资产交易所“中铁11号”收益分享合约产品，本产品在天津金融资产交易所挂牌发行。\\n产品特点：\\n稳收益：预期年化收益达6.123%\\n低风险：本收益分享合约产品的底层资产相关交易由上市公司提供担保增信\\n超安心：国有金融交易中心甄选优质投资标的</p>\",\"publishStatus\":\"notIssue\",\"purchaseDesc\":\"<p>本产品直接使用账户可用余额购买，请提前安排资金，资金可使用绑定卡转入账户参与购买。\\n产品总规模10000000元，起购金额40000元，追加金额10000元的整数倍，单笔最大购买金额1000000元，可多次购买。\\n2019-06-19\\u00A009：00面向全体用户发售。\\n本产品起息日为2019年06月21日，到期日为2109年09月19日，产品到期后本金及利息收益将于3个工作日内转入您的账户余额。\\n请您在购买产品前仔细阅读并确认产品合同及认购协议。</p>\",\"reasonsPrepay\":\"<p>产品管理人享有在起息日满45天后的投资期限内任一天提前终止该产品的权利，并在提前终止日前3个工作日发布通知。投资人无法选择提前结束</p>\",\"remark\":\"不合格\",\"repayType\":\"principalAndInterestTotally\",\"status\":\"init\",\"tenderAmount\":0.00,\"tenderAuditStatus\":\"init\",\"tenderAuditTime\":\"2019-08-26 16:19:20\",\"tenderAuditorId\":\"1\",\"tenderAuditorName\":\"系统管理员\",\"tenderEndTime\":\"2019-09-30\",\"tenderIncreaseAmount\":100000.00,\"tenderInitAmount\":1500000,\"tenderStartTime\":\"2019-08-27\",\"tenderUsers\":0,\"timeLimit\":100,\"timeLimitUnit\":\"day\"},\"productOtherAtta