INSERT INTO `SYS_BUSINESS_LOG` VALUES ('2839', '24', 'liulin', '测试', '51cd3bab-4ef5-4883-9da5-04d51b47a18e', '2019-09-19 10:51:29', '投资观点管理', '投资观点上下架', '{\"content\":\"<p>发改委网站29日发布消息称，国家发展改革委、证监会等28部门联合签署了《关于对社会保险领域严重失信企业及其有关人员实施联合惩戒的合作备忘录》。其中，备忘录明确规定，在股票、可转换债券发行审核及在全国中小企业股份转让系统挂牌公开转让审核中，将失信信息作为参考，由证监会负责实施</p><p>根据合作备忘录，联合惩戒的对象是指人力资源社会保障部、税务总局和医疗保障局会同有关部门确定的违反社会保险相关法律、法规和规章的企事业单位及其有关人员，其严重失信、失范行为主要包括以下情形：</p><p>（一）用人单位未按相关规定参加社会保险且拒不整改的；</p><p>（二）用人单位未如实申报社会保险缴费基数且拒不整改的；</p><p>（三）应缴纳社会保险费却拒不缴纳的；</p><p>（四）隐匿、转移、侵占、挪用社会保险费款、基金或者违规投资运营的；</p><p>（五）以欺诈、伪造证明材料或者其他手段参加、申报社会保险和骗取社会保险基金支出或社会保险待遇的；</p><p>（六）非法获取、出售或变相交易社会保险个人权益数据的；</p><p><br/></p>\",\"createTime\":\"2019-07-31 18:02:40\",\"creatorId\":\"26\",\"creatorName\":\"李洪斌\",\"dataStatus\":\"1\",\"editTime\":\"2019-09-12 11:04:21\",\"editorId\":\"24\",\"editorName\":\"测试\",\"id\":\"19073118023985180844\",\"logo\":\"http://127.0.0.1:85/resources/upload/temp/investmentArticle/26/2019-07-31/19073118021150014330.png\",\"source\":\"第一财经\",\"status\":\"1\",\"summary\":\"备忘录明确规定，在股票、可转换债券发行审核及在全国中小企业股份转让系统挂牌公开转让审核中，将失信信息作为参考，由证监会负责实施。\",\"title\":\"下架28部门发布联合备忘录：IPO审核将参考申请对象社保失信信息\"}', null, '192.168.1.95');
